   try {
    const pool = await sql.connect(dbSettings); //funcion asincrona - promesa 
    // const result = await pool.request().query('SELECT 1'); //consulta de seleciconar 1
    // console.log(result);
    return pool; //para que cualquier codigo lo ejeecute 
   } catch (error) {
     console.error(error);
   }
}

